"use strict";

const findAnagrams = (s, p) => {
    const counter = new Map();
    for (let i = 0; i < p.length; i++) {
        counter.set(p[i], (counter.get(p[i]) || 0) + 1);
    }
    const ans = [];
    let left = 0, right = 0;
    const t = new Map();
    while (right < s.length) {
        t.set(s[right], (t.get(s[right]) || 0) + 1);
        while (t.get(s[right]) > counter.get(s[right])) {
            t.set(s[left], t.get(s[left]) - 1);
            left++;
        }
        if (right - left + 1 === p.length) {
            ans.push(left);
        }
        right++;
    }
    return ans;
};
